import React, { useEffect, useState } from "react";
import NavigationBar from "../components/navbar.jsx";

export default function History() {
  const [offers, setOffers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [serverError, setServerError] = useState(false);

  const fetchOffers = async () => {
    try {
      const token = localStorage.getItem("token");
      const res = await fetch("http://localhost:5001/api/offers/closed/30days", {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });

      const data = await res.json();
      setOffers(data.data || []);
    } catch (err) {
      setServerError(true);
    }

    setLoading(false);
  };

  useEffect(() => {
    fetchOffers();
  }, []);

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString();
  };

  const statusColors = {
    completed: "bg-emerald-600",
    cancelled: "bg-red-600",
    pending: "bg-yellow-500",
  };

  return (
    <div className="min-h-screen pb-24 bg-gradient-to-b from-green-700 to-green-900 text-white px-4 py-6">

      <h1 className="text-3xl font-extrabold text-center mb-8 flex items-center justify-center gap-2">
        âš¡ Energy Trading History
      </h1>

      {/* Server error */}
      {serverError && (
        <div className="text-center text-lg font-semibold text-red-300 bg-red-800/40 py-3 rounded-xl">
          Connecting to server...
        </div>
      )}

      {/* Loading */}
      {loading && !serverError && (
        <div className="text-center text-lg font-semibold text-yellow-200">
          Loading history...
        </div>
      )}

      {/* No offers */}
      {!loading && !serverError && offers.length === 0 && (
        <div className="text-center text-xl text-gray-200 bg-white/10 py-5 rounded-xl border border-white/20">
          No closed offers in the last 30 days.
        </div>
      )}

      {/* Offer cards */}
      <div className="space-y-6">
        {offers.map((offer) => (
          <div
            key={offer._id}
            className="bg-white/90 text-gray-900 p-6 rounded-2xl shadow-xl border border-gray-300 backdrop-blur-md max-w-xl mx-auto"
          >
            <div className="flex justify-between items-center mb-2">
              <h2 className="text-xl font-bold flex items-center gap-1">
                âš¡ {offer.offer_id}
              </h2>
              <span
                className={`px-3 py-1 rounded-full text-white text-sm font-semibold ${
                  statusColors[offer.status] || "bg-gray-600"
                }`}
              >
                {offer.status.charAt(0).toUpperCase() + offer.status.slice(1)}
              </span>
            </div>

            <p className="text-gray-700">
              <strong>Type:</strong> {offer.offer_type}
            </p>

            <p className="text-gray-700">
              <strong>Units:</strong> {offer.units} kWh
            </p>

            <p className="text-gray-700">
              <strong>Rate/Unit:</strong> {offer.token_per_unit} Tokens
            </p>

            <p className="text-gray-800 font-bold">
              <strong>Total Tokens:</strong> {offer.total_tokens}
            </p>

            <div className="mt-4 p-3 bg-gray-100 rounded-xl">
              <p className="text-gray-800">
                <strong>Created By:</strong> {offer.creator_id}
              </p>

              {offer.negotiated_by && (
                <p className="text-gray-800 mt-1">
                  <strong>Accepted By:</strong> {offer.negotiated_by}
                </p>
              )}
            </div>

            <div className="mt-4 space-y-1 text-sm text-gray-600">
              <p>ðŸ•’ <strong>Created:</strong> {formatDate(offer.created_at)}</p>

              {offer.completed_at && (
                <p>âœ… <strong>Completed:</strong> {formatDate(offer.completed_at)}</p>
              )}
            </div>
          </div>
        ))}
      </div>

      <NavigationBar active="History" />
    </div>
  );
}
